import React from 'react'

function Header() {
    return (
        <div>
            <nav className="navbar navbar-light" 
            style= {{
                backgroundColor: "#ffffff"
            }}>
            <a className="header-name" href="/" style={{
                color: "6d98ba",
                paddingLeft: "30px"
            }}>Error and Log Management</a>
        </nav>

        </div>
    )
}
export default Header;
